import ImageSubject from '../favicon.ico';
export default function TopSubject() {
  return (
    <div className="py-1 text-center" xs="3">
      <h4 className="d-flex justify-content-center align-items-center mt-2">
        <button>

          <img src={ImageSubject} alt="ddd" className="w-50" />
        </button>
      </h4>
    </div>
  );
}
